const duracaoTotal = parseFloat($item(0).$node['EditFields1'].json.duracaoAudio);
const numeroDeImagens = 6; // Se você tiver 6 imagens (0 a 5)

const duracaoPorImagem = duracaoTotal / numeroDeImagens;

return [
  {
    json: {
      duracaoTotal: duracaoTotal,
      // Retorna a duração por imagem, formatada com 3 casas decimais
      imageDuration: duracaoPorImagem.toFixed(3)
    }
  }
];
